import logo from './logo.svg';
import './App.css';

import Home from './Home'

import { BrowserRouter as  Router, Route, Switch } from 'react-router-dom'
function App() {
  return (
    <div className="App">
      <Router>
      <Switch>
        <Route path="/home" component={Home}> </Route>
        <Route path="/contact"></Route>
        <Route path="/service"></Route>
      </Switch>
      </Router>
    </div>
  );
}


export default App;
